window.bookSummaryJSON = "<p><b>Tantor Audio presents Books 1-3 in </b><b><i>USA Today</i></b><b> bestselling author Nancy Warren's Vampire Knitting Club series.</b></p> <p>Lucy inherits an Oxford knitting shop...and so much more....</p> <p>Like the vampires who live downstairs and pop up to the shop when they run out of wool, or for their late-night knitting club. They've even offered to help Lucy learn how to knit. She discovers she's a witch and has some quirky relatives she never knew about. Her grandmother's supposed to be dead, but keeps showing up. It's enough to send Lucy screaming back to Boston, except there's a mystery to solve and Oxford and her new vampire friends are kind of growing on her....</p>"; 
